private static boolean isAncestorOf(Path ancestor, Path f) {
  String aStr = ancestor.toString();
  if (!ancestor.isRoot()) {
    aStr += "/";
  }
  String fStr = f.toString();
  return (fStr.startsWith(aStr));
}
